import React from "react";
import styled from "styled-components";
import { FONTS, WEIGHTS } from "../../Constants";

const Header = () => {
  return (
    <Wrapper>
      <Brand>Sole&Anlke</Brand>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
  align-items: center;
`;

const Brand = styled.span`
  font-family: ${FONTS.raleway}
  font-size: ${24 / 16}rem;
  weight: ${WEIGHTS.bold}
  margin-right: auto;
`;

const CategoriesNav = styled.nav`
  display: flex;
  jusity-content: space-evenly;
  align-items: center;
  font-family: ${FONTS.raleway};
`;

export default Header;
